// Solution 1:
function sortByHeight(arr) {
    let sorted = arr.filter((el, i) => el!== "g").sort();
    for (let i = 0; i < arr.length; i++) {
        if (arr[i] === "g") {
            sorted.splice(i, 0, "g");
        }
    }
    return sorted;
}

